// src/components/Navbar.js
import React from 'react';

const Navbar = () => {
  return (
    <header className="p-3 bg-dark text-white">
      <div className="container">
        <div className="d-flex flex-wrap align-items-center justify-content-between justify-content-lg-start">
          {/* Logo and E-Commerce Name */}
          <a href="/" className="d-flex align-items-center mb-2 mb-lg-0 text-white text-decoration-none">
            {/* <img src="https://via.placeholder.com/150x50?text=Logo" alt="Logo" className="d-inline-block align-text-top" /> */}
            {/* <span className="ms-2 fs-4">E-Commerce</span> */}
          </a>

          {/* Navbar Links */}
          <ul className="nav col-12 col-lg-auto me-lg-auto mb-2 justify-content-center mb-md-0">
            <li><a href="/" className="nav-link px-2 text-white">หน้าหลัก</a></li>
            <li><a href="/cart" className="nav-link px-2 text-white">ตะกร้า</a></li>
            <li><a href="/about" className="nav-link px-2 text-white">เกี่ยวกับ</a></li>
            <li><a href="/contact" className="nav-link px-2 text-white">ติดต่อ</a></li>
          </ul>

          {/* Search Form */}
          <form className="col-12 col-lg-auto mb-3 mb-lg-0 me-lg-3">
            <input
              type="search"
              className="form-control form-control-dark"
              placeholder="Search..."
              aria-label="Search"
            />
          </form>

          {/* Login and Sign-up Buttons */}
          <div className="text-end">
            <button type="button" className="btn btn-outline-light me-2">Login</button>
            <button type="button" className="btn btn-warning">Sign-up</button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
